import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <form name="userName" action="/lost" method="post">
          <label for="userName">User Name</label>
          <input type="text"></input>
          <input type="submit" value="Submit"></input>
        </form>
      </header>
    </div>
  );
}

export default App;
